import React from "react";

const Details = () => {
  return (
    <div className="col-12 col-lg-4">
      <form onSubmit={onSubmitHandler}>
        <InputGroup
          label="Email"
          type="text"
          name="Email"
          onChangeHandler={onChangeHandler}
          errors={errors.Email}
        />
        <InputGroup
          label="Firstname"
          type="text"
          name="Firstname"
          onChangeHandler={onChangeHandler}
          errors={errors.Firstname}
        />
        <InputGroup
          label="Lastname"
          type="text"
          name="Lastname"
          onChangeHandler={onChangeHandler}
          errors={errors.Lastname}
        />
        <InputGroup
          label="Age"
          type="text"
          name="Age"
          onChangeHandler={onChangeHandler}
          errors={errors.Age}
        />
        <button className="btn btn-primary" type="submit">
          Add user
        </button>
      </form>
    </div>
  );
};

export default Details;
